SELECT ?property ?hasValue ?isValueOf
WHERE {
  { <http://dbpedia.org/resource/José_Lasa> ?property ?hasValue }
  UNION
  { ?isValueOf ?property <http://dbpedia.org/resource/José_Lasa> }
}

PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>
PREFIX dc: <http://purl.org/dc/elements/1.1/>
PREFIX : <http://dbpedia.org/resource/>
PREFIX dbpedia2: <http://dbpedia.org/property/>
PREFIX dbpedia: <http://dbpedia.org/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
PREFIX dbprop: <http://dbpedia.org/property/>
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?jugador ?jugadornom ?clubactual ?clubnom ?posicion ?posicionnom ?procedencia ?procnom ?altura ?foto ?comentario

WHERE { 

?jugador a dbo:SoccerPlayer.
?jugador rdfs:label ?jugadornom.

OPTIONAL {?jugador dbprop:currentclub  ?clubactual .}
OPTIONAL {?clubactual a dbo:SoccerClub.}
OPTIONAL {?clubactual rdfs:label ?clubnom.}

OPTIONAL {?jugador dbo:birthPlace  ?procedencia. FILTER NOT EXISTS {?procedencia a dbo:SoccerClub }  .}
#OPTIONAL {?procedencia a <http://schema.org/Country>. }#  
#OPTIONAL {?procedencia rdfs:label ?pais. }#
OPTIONAL {?procedencia rdfs:label ?procnom. }

OPTIONAL {?jugador dbprop:position ?posicion.}
OPTIONAL {?posicion rdfs:label ?posicionnom.}

OPTIONAL {?jugador dbo:height ?altura.}
OPTIONAL%

