PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>
PREFIX dc: <http://purl.org/dc/elements/1.1/>
PREFIX : <http://dbpedia.org/resource/>
PREFIX dbpedia2: <http://dbpedia.org/property/>
PREFIX dbpedia: <http://dbpedia.org/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
PREFIX dbprop: <http://dbpedia.org/property/>
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?team  ?country ?jugadores ?nombre ?age ?posicion ?posnom ?equipo ?eqnom
WHERE { 
?team rdfs:label ?name. 
?team dbpprop:fifaRank ?rank.
OPTIONAL {?team dbpprop:name ?jugadores.}
OPTIONAL {?jugadores  a dbo:SoccerPlayer .}
OPTIONAL {?jugadores rdfs:label ?nombre.}
optional {?jugadores dbpedia2:currentclub ?equipo.}
OPTIONAL {?equipo rdfs:label ?eqnom.}

optional {?jugadores dbprop:position ?posicion.}
OPTIONAL {?posicion rdfs:label ?posnom.}




OPTIONAL {?jugadores dbpprop:birthDate ?nacimiento.}
 bind( xsd:int(year(now())) as ?nowYear )
  bind( if( datatype(?nacimiento) = xsd:dateTime || datatype(?nacimiento) = xsd:date, 
            year(xsd:dateTime(?nacimiento)),
   %2

